// Globals
let inp = null; // input
let scr = null; // screen
let aud = null; // audio
let elapTime=null; // elapsed time to grab all mushrooms
let startTime = null; //start collecting mushrooms


const player = {
	x: 90,
	y: 30,
	speed: 0.5,
	isWalking: false,
	flip: 0,
	framesSinceWalkStart: 0
}

const mushrooms = [
	{  
		x: 20,
		y: 30,
		wasGrabbed: false
	},
	{  
		x: 130,
		y: 95,
		wasGrabbed: false
	}
];
const blackMushrooms = [
	{  
		x: 130,
		y: 30,
		wasGrabbed: false
	}

];
let numberOfGrabbedMushrooms = 0;
let numberOfGrabbedBlackMushrooms=0;
let totalNumberOfMushrooms=2;

let randomColor = 1;

// initialization
engine.onInit = () => {
	inp = engine.input;
	scr = engine.screen;
	aud = engine.audio;

	updateColors();
};


// update loop
engine.onUpdate = () => {
  scr.clear( 1 );

	scr.drawMap(
	  0,      // originX on map
	  0,      // originY on map
	  -1,     // width
	  -1,     // height
	  0,      // screenX
	  0,      // screenY
	  0       // tilemap index
	);

	drawMushrooms();

	updatePlayer();

	let textMainColor = 2;
	if ( numberOfGrabbedMushrooms > 0 ) {
		textMainColor = randomColor;
	}

	let textPositionOffset = 0;
	if ( numberOfGrabbedMushrooms > 1 ) {
		textPositionOffset = Math.sin( engine.realTimeSinceGameStart * 10 ) * 8;
	}

	scr.drawText(
		'So what?',
		50,
		90 + Math.floor( textPositionOffset ),
		textMainColor,
		1,
		0
	);
	if ((totalNumberOfMushrooms==numberOfGrabbedMushrooms) && (numberOfGrabbedBlackMushrooms!=0)){
		  console.log("-----------FINAL Grabbing------>ENGINE UPDATED "+numberOfGrabbedMushrooms)

		  let textMainColor = 2;


		  scr.drawText(
		    'Elapsed Time: '+elapTime+'sec',
		    50,
		    20,
		    textMainColor,
		      1,
		    0
	    );
	      }
};

function drawMushrooms() {
	mushrooms.forEach( mushroom => {
		if ( !mushroom.wasGrabbed ) {
			scr.drawTile(
				61,
				mushroom.x - 8, // center on the position
				mushroom.y - 8, // center on the position
				0
			);
		}
	} );

}
function drawTheBlack(){
  let black=blackMushrooms[0];
  if ( !black.wasGrabbed ) {
			scr.drawTile(
				62,
				black.x - 8, // center on the position
				black.y - 8, // center on the position
				0
			);
		}

}

function updatePlayer() {
	let newX = player.x;
	let newY = player.y;

	let isWalking = false;
	if ( inp.left.pressed ) {
		newX -= player.speed;
		isWalking = true;
		player.flip = 1;
	}
	else if ( inp.right.pressed ) {
		newX += player.speed;
		isWalking = true;
		player.flip = 0;
	}

	if ( inp.down.pressed ) {
		newY -= player.speed;
		isWalking = true;
	}
	else if ( inp.up.pressed ) {
		newY += player.speed;
		isWalking = true;
	}

	if ( isWalking ) {
		player.framesSinceWalkStart += 1;
	}

	// play or stop audio
	if ( isWalking && !player.isWalking ) {
		// started walking
		player.framesSinceWalkStart = 0;

		let note = bitmelo.Notes.C4;
		if ( numberOfGrabbedMushrooms > 1 ) {
			note = bitmelo.Notes.C2;
		}
		else if ( numberOfGrabbedMushrooms > 0 ) {
			note = bitmelo.Notes.C3;
		}

		aud.playInfiniteSound(
			0,
			note,
			0.5,
			2
		);
	}
	else if ( !isWalking && player.isWalking ) {
		// stopped walking
		aud.stopInfiniteSound( 0 );
	}

	player.isWalking = isWalking;

	// make sure we are not colliding with the fence
	if ( 
		newX >= 16
		&& newX < scr.width - 16
		&& newY >= 24
		&& newY < scr.height - 16
	) {
		player.x = newX;
		player.y = newY;
	}

	// check mushroom collisions
	for ( let i = 0; i < mushrooms.length; i += 1 ) {
		const mushroom = mushrooms[i];
		if ( !mushroom.wasGrabbed ) {
			const deltaX = Math.abs( player.x - mushroom.x );
			const deltaY= Math.abs( player.y - mushroom.y );
			const distance = Math.sqrt( deltaX * deltaX + deltaY * deltaY );

			// player has grabbed a mushroom
			if ( distance <= 12 ) {
				mushroom.wasGrabbed = true;
				numberOfGrabbedMushrooms += 1;
	//	console.log("-----------Grabbed------>"+numberOfGrabbedMushrooms)		
				aud.playSound(
					1,
					bitmelo.Notes.E3,
					48,
					0.25,
					1
				);
				if ((totalNumberOfMushrooms==numberOfGrabbedMushrooms) && (numberOfGrabbedBlackMushrooms!=0)){
		  console.log("-----------FINAL Grabbing------>"+numberOfGrabbedMushrooms)
		  aud.playSound(
					3,
					bitmelo.Notes.E3,
					48,
					4,
					3
				);
		  stopTimer();

	      }
			}
		}
	}	


	//Draw black mushroom
	if (numberOfGrabbedMushrooms == 1) {
	  drawTheBlack();
	}
	//check collision with the black
	for ( let i = 0; i < blackMushrooms.length; i += 1 ) {
		const bmushroom = blackMushrooms[i];
		if ( !bmushroom.wasGrabbed ) {
			const deltaX = Math.abs( player.x - bmushroom.x );
			const deltaY= Math.abs( player.y - bmushroom.y );
			const distance = Math.sqrt( deltaX * deltaX + deltaY * deltaY );

			// player has grabbed a mushroom
			if ( distance <= 12 ) {
				bmushroom.wasGrabbed = true;
				numberOfGrabbedBlackMushrooms += 1;

				aud.playSound(
					2,
					bitmelo.Notes.G5,
					48,
					3,
					1
				);
				// Get the current time in milliseconds
const currentTime = new Date().getTime();

// Use the current time to produce a random number between 1 and 30
const randomSeed = currentTime % 50; // Get a number between 0 and 29
const randomNumber = randomSeed + 1; // Add 1 to make the range 1 to 30

generateRandomMushrooms(randomNumber);
totalNumberOfMushrooms+=randomNumber;
startTimer();
			}

		}
	}



	// draw the player
	const bmushroom = blackMushrooms[0];
	let frameGID = 1;
	if (!bmushroom.wasGrabbed){

    if ( player.isWalking ) {
		  if ( player.framesSinceWalkStart % 16 < 8 ) {
			  frameGID = 2;
		  }
		  else {
			  frameGID = 3;
		  }
	  }
	}
	else{
	  player.speed=2;
	  frameGID = 4;
    if ( player.isWalking ) {
		  if ( player.framesSinceWalkStart % 16 < 8 ) {
			  frameGID = 5;
		  }
		  else {
			  frameGID = 6;
		  }
	  }
	}
	scr.drawTile(
		frameGID,
		Math.floor( player.x ) - 8, // center the tile on the position
		Math.floor( player.y ) - 8, // center the tile on the position
		player.flip
	);
}

function updateColors() {
	randomColor = Math.floor( Math.random() * 16 ) + 1;
	setTimeout( updateColors, 100 );
}


//Generate mushrooms randomly
function generateRandomMushrooms(r){
  console.log(r);
  const randomNumbersArrayX = generateUniqueRandomNumbers(20,170,r);
  const randomNumbersArrayY = generateUniqueRandomNumbers(20,110, r);
  //console.log("X---->"+randomNumbersArrayX);
  //console.log("Y---->"+randomNumbersArrayY);
  for (let i = 0; i < r; i++) {
    const mushroom = {
        x: randomNumbersArrayX[i],
        y: randomNumbersArrayY[i],
        wasGrabbed: false
    };
    mushrooms.push(mushroom);
  }
  drawMushrooms();
}

function generateUniqueRandomNumbers(min, max, count) {
    //const min = 20;    // Minimum value
    // const max = 170;   // Maximum value
   // const count = r;  // Number of random numbers to generate
    const step = 20;   // Difference between consecutive numbers

    const randomNumbers = [];
    let currentNumber;

    while (randomNumbers.length < count) {
        // Generate a random number

        currentNumber = Math.floor(Math.random() * (max - min + 1)) + min;
console.log(count);
        // Check if the number is not already in the array and if it's within the range
        if (!randomNumbers.includes(currentNumber)) {
            if (randomNumbers.length > 0) {
                // Ensure the difference between the new number and the last number is 20
                const diff = Math.abs(currentNumber - randomNumbers[randomNumbers.length - 1]);
                if (diff >= step) {
                    randomNumbers.push(currentNumber); // Add the number to the array
                }
            } else {
                randomNumbers.push(currentNumber); // Add the first number to the array
            }
        }
    }

    return randomNumbers;
}

function startTimer() {
    startTime = new Date();
    timerStarted = true;
    console.log("Timer started.");
}

function stopTimer() {
    const endTime = new Date();
    elapTime = (endTime - startTime) / 1000; // Time difference in seconds

    console.log(`Time difference: ${elapTime} seconds`);
    console.log(`Time difference: ${elapTime / 60} minutes`); // Time difference in minutes
    timerStarted = false;
    console.log("Timer stopped.");
}
